import React, { useState } from 'react';
import { Menu } from 'antd';
import { HomeOutlined, BarChartOutlined, TableOutlined, LogoutOutlined} from '@ant-design/icons';
import logoUrl from '../images/logo-dark.png';
import LogoutButton from './LogoutButton';

const { SubMenu } = Menu;
const menuKeys = ['1', '2', '3'];

function NavSider() {

    const [openKeys, setOpenKeys] = useState(['1']);

    const onOpenChange = keys => {
      const latestOpenKey = keys.find(key => openKeys.indexOf(key) === -1);
      if (menuKeys.indexOf(latestOpenKey) === -1) {
        setOpenKeys(keys);
      } else {
        setOpenKeys(latestOpenKey ? [latestOpenKey] : []);
      }
    };

    return (
        <>
        <div className="logo">
          <a  href="https://techstars.com">
          <img src={logoUrl} alt="techstarts icon" />
          </a>
        </div>
        <Menu theme='dark' mode="inline" openKeys={openKeys} onOpenChange={onOpenChange}>
          <SubMenu key="1" icon={<HomeOutlined />} title="Home">
            <Menu.Item key="sub1">Matching</Menu.Item>
            <Menu.Item key="sub2">Scheduling</Menu.Item>
          </SubMenu>
          <Menu.Item key="2" icon={<BarChartOutlined  />}>
            Dashboard22
          </Menu.Item>
          <Menu.Item key="3" icon={<TableOutlined />}>
            Results
          </Menu.Item>
          <Menu.Item key="4" icon={<LogoutOutlined />}>
            <LogoutButton/>
          </Menu.Item>
        </Menu>
        </>
    )
}
export default NavSider;
